import React from 'react'

const Project = ({projects}) => {

    const projectElements = projects.map((project, index) => 
        (
            <div class="col-xs-12 col-md-6 col-lg-4 mb-4" key={index}>
                <div class="card text-center bg-light border-dark rounded h-100 p-4" data-index={0}>
                <img src="img/Project3NewResize.png" class="card-img-top img-fluid mb-4" alt={`Project${project.number}`}/>
                <h5 class="card-title">{project.name}</h5>
                <p class="skills-used mt-auto card-text"><span class="font-weight-bold">Skills Used:</span> {project.skills}</p>
                <a href={`https://github.com/jonhayjr/Treehouse-FEWD-Project${project.index}`} class="btn btn-secondary mb-4 d-md-none w-75 mx-auto" target="_blank">View Code</a>
                <a href={`https://jonhayjr.com/Treehouse-FEWD-Project${project.index}/`} class="btn btn-dark d-md-none w-75 mx-auto" target="_blank">Go to Website</a>
                </div> 
            </div>
        )
    );
    return (
        <div>
            {projectElements
            }
        </div>
    )
}

export default Project
